import './Login.css';
import { useState } from 'react';
import { useNavigate } from 'react-router-dom';

export default function DoctorLogin() {
    const[signUp, setSignUp] = useState(false);
    const[signIn, setSignIn] = useState(false);
    const[id, setID] = useState(null);
    const[name, setName] = useState("");
    const navigate = useNavigate();

    // Handle choice between sign up and sign in
    const handleChoice = (input) => {
        if (input === "sign up") {
            setSignUp(true);
        } else if (input === "sign in") {
            setSignIn(true);
        }
    }

    // Handle sign in 
    const handleSignIn = () => {
        navigate('/Doctor');
    }

    // Handle sign up
    const handleSignUp = () => {
        navigate('/Doctor');
    }

    return (
        <div>
            <h1>Doctor</h1>

            {!signIn && !signUp ? (
                <div className="account-container">
                    <button className="account-button" onClick={() => handleChoice("sign in")}>Sign In</button>
                    <button className="account-button" onClick={() => handleChoice("sign up")}>Create An Account</button>
                </div>
            ): null}

            {signIn ? (
                <div>
                    <form className="login-form">
                        <div className="login-form-item">
                            <label>Enter Doctor ID:</label>
                            <input 
                                type="number" value={id} onChange={(e) => setID(e.target.value)}
                            />
                        </div>
                        <button onClick={handleSignIn} type="submit">Sign In</button>
                    </form>
                    <button onClick={() => setSignIn(false)}>Back</button>
                </div>
            ) : null}

            {signUp ? (
                <div> 
                    <form className="login-form">
                        <div className="login-form-item">
                        </div>
                        <div className="login-form-item">
                            <label>Name:</label>
                            <input 
                                type="number" value={name} onChange={(e) => setName(e.target.value)}
                            />
                        </div>
                        <button onClick={handleSignUp} type="submit">Sign Up</button>
                    </form>
                    <button onClick={() => setSignUp(false)}>Back</button>
                </div>
            ) : null}
        </div>
    )
}
